import React from 'react'
import "./input.css"

const App = () => {
  return (
    <div className="xl:container mx-auto grid place-items-center h-screen">
      <div className="grid grid-rows-1 content-center">
        <div className="grid grid-cols justify-center">
          <h1 className='p-3'>Hello World</h1>
          </div>
      </div>
    </div>
  )
}

export default App;
